import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>



        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <iframe src="https://trinket.io/embed/pygame/f9650decb4?outputOnly=true" width="200%" height="50" frameborder="0" marginwidth="0" marginheight="0" allowfullscreen></iframe>

      </header>
    </div>
  );
}

export default App;
